DROP TABLE [dbo].[Users];
GO


CREATE TABLE [dbo].[Users]
(
[UserId] [int] NOT NULL,
[FirstName] [nchar] (15) COLLATE Hebrew_CI_AS NOT NULL,
[LastName] [nchar] (15) COLLATE Hebrew_CI_AS NOT NULL,
[Age] [int] NOT NULL
)
GO

CREATE NONCLUSTERED INDEX [FirstNameIndex] ON [dbo].[Users] ([FirstName]) INCLUDE ([Age], [LastName], [UserId])
GO

CREATE NONCLUSTERED INDEX [LastNameIndex] ON [dbo].[Users] ([LastName]) INCLUDE ([Age], [FirstName], [UserId])
GO


